(function() {
    var assoc, msg;
    stm_document.properties['lecm-signing-v2-aspects:isSigned'] = true;
    stm_document.properties['lecm-signing-v2-aspects:signingState'] = 'COMPLETE';
    stm_document.properties['lecm-signing-v2-aspects:signingDate'] = base.getValueConverter().convertValueForJava(new Date());
    stm_document.save();
    assocs = stm_document.assocs['lecm-signing-v2-aspects:signerEmployeeAssoc'];
    if (assocs && assocs.length) {
        stm_document.removeAssociation(assocs[0], 'lecm-signing-v2-aspects:signerEmployeeAssoc');
    }
    stm_document.createAssociation(orgstructure.getCurrentEmployee(), 'lecm-signing-v2-aspects:signerEmployeeAssoc');

    msg = "#initiator подписал(а) документ " + documentScript.wrapperDocumentLink(stm_document, "{lecm-document:ext-present-string}");
    businessJournal.log(stm_document.nodeRef.toString(), "SIGNING", substitude.formatNodeTitle(stm_document.nodeRef.toString(), msg), []);
})();

